import React from "react";
import { Route, Switch } from "react-router";
import { Home } from "../Components/Home/Home";

function Routes() {
  return (
    <div>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
      </Switch>
    </div>
  );
}

export { Routes };
